contract Inter is LibContract{
    using InterMaps for InterMaps.MapAddr2Inter;
    using SafeMath for uint;

    address owner;

    uint constant MARGIN_THRESHOLD_INTER  = 100;    // Inter

    event Register(address addr, string nodeid, uint amount);
    event ModifyNodeId(address addr, string nodeid, uint amount);
    event ApplyForLock(address addr, uint locktime);
    event ApplyForUnLock(address addr, uint locktime);
    event UnRegister(address addr, string nodeid, uint amount);
    event SelectInter(address tableManage,uint256 tableid, address playerAddr, uint number);
    event ApplyForInter(address roomAddr, uint tableId, uint number);
    event RportFailInter(address roomAddr, uint tableId, address interAddr);
    event RecordFailInter(address roomAddr, uint tableId, address interAddr);
    event ReApplyForInter(address roomAddr, uint tableId, uint number);

    struct ExceptionInfo {
        address     addr;       // Inter1,table; 2,table
