   // mapping(address => mapping(uint256 => address[]))   table2inters;   // table -- inter

    mapping(address => mapping(uint => address[]))  room2tbInAddr;      // room -- (tableId -- Inter) 
    mapping(address => mapping(uint => address[]))  room2tbInAddr_I;    // room -- (tableId -- Inter) 
    mapping(address => mapping(uint => uint))       room2tbNrNum;       // room -- tableInter

    mapping (address => mapping(uint => ExceptionInfo[]))  room2tbExcNr;   // room -- (table -- Inter)
                                                        // ( mapping (uint => mapping(address => address[]))
    mapping(address => uint) nrAddr2failCout;   //  -- Inter
    mapping(address => uint) nrAddr2SuccCout;   //  -- Inter

    constructor() public {
        owner = msg.sender;
        _setContract("InterManager",this); //
    }

    function setTableMgr(address tableMgr) public {
        assert(msg.sender == owner);
        games[tableMgr]=true;
        //tableMgrAddr = tableMgr;
    }

    //function getTableMgr() public view returns(address) {
