    /**
     * @dev Inter
     * @param table table
     * @param interAddr inter
     * @param totHand 
     * @param succHand 
     */
    function runInfo2(address table, address interAddr, uint totHand, uint succHand) public {
        if(!addr2Inters.contains(interAddr)) {
            return;
        }

        InterMaps.InterInfo memory interInfo = addr2Inters.get(interAddr);
        interInfo.totHand = interInfo.totHand.add(totHand);
        interInfo.succHand = interInfo.succHand.add(succHand);

        addr2Inters.insert(interAddr, interInfo);
    }

    /**
     * @dev inter
     */
    function numberOfInter() public view returns (uint) {
        return addr2Inters.size();
    }

    /**
     * @dev inter
     */
    function numberOfUnlockInter() public view returns (uint) {
        uint total = addr2Inters.size();

        uint number = 0;
        for(uint i = 0; i < total; i++) {
            if(0 == addr2Inters.getValueByIndex(i).locktime) {
                number++;
            }
        }

        return number;
    }

