    //inter
    function select(uint256 tableId, address playerAddr, uint number) public returns(string ret) {
        address roomAddr = msg.sender;
        if(0 != room2tbInAddr[roomAddr][tableId].length){
            return  "this table has allocated inters";
        }
        if(number == 0){
            return "number cont be zero";
        }

        uint interNum = numberOfInter();
        uint interUnlockNum = numberOfUnlockInter();
        if(number >interUnlockNum){
            return "inter not enough";
        }

        uint8[] memory selected = new uint8[](interNum);

        uint selectedNum = number;
        uint index;
        uint seed = uint(msg.sender);

        while(number > 0) {
            seed = rand(seed);
            index = seed % interNum;
            while(1 == selected[index] || 0 != addr2Inters.getValueByIndex(index).locktime) {
                index = (index + 1) % interNum;
            }

            number--;
            selected[index] = 1;
            room2tbInAddr[roomAddr][tableId].push(addr2Inters.getKeyByIndex(index));
        }

        room2tbNrNum[roomAddr][tableId] = selectedNum;

        emit ApplyForInter(roomAddr, tableId, selectedNum);
        return "";
    }

    function reSelect(uint tableId) public returns(string){
        address roomAddr= msg.sender;
        uint interNum = numberOfInter();
        uint i;

        uint8[] memory selected = new uint8[](interNum);
        // for(i = 0; i < interNum; i++) {
        //     selected[i] = 0;
        // }

        address tmpAddr;
        for(i = room2tbInAddr[roomAddr][tableId].length; i > 0; i--) {
            tmpAddr = room2tbInAddr[roomAddr][tableId][i - 1];
            room2tbInAddr_I[roomAddr][tableId].push(tmpAddr);
            delete room2tbInAddr[roomAddr][tableId][i - 1];
        }

        room2tbInAddr[roomAddr][tableId].length = 0;

        for(i = 0; i < room2tbInAddr_I[roomAddr][tableId].length; i++) {
            tmpAddr = room2tbInAddr_I[roomAddr][tableId][i];
            if(addr2Inters.contains(tmpAddr)) {
                selected[addr2Inters.getIndexByKey(tmpAddr)] = 1;
            }
        }

        uint number = room2tbNrNum[roomAddr][tableId];
        uint selectedNum = 0;

        uint index;
        uint guard;
        bool finish;
        uint seed = uint(msg.sender);
        while(selectedNum < number) {
            seed = rand(seed);
            index = seed % interNum;
            guard = index;
            finish = false;
            while(1 == selected[index] || 0 != addr2Inters.getValueByIndex(index).locktime) {
                index = (index + 1) % interNum;
                if(index == guard) {
                    finish = true;
                    break;
                }
            }

            if(finish) {
                break;
            }

            selectedNum++;
            selected[index] = 1;
            room2tbInAddr[roomAddr][tableId].push(addr2Inters.getKeyByIndex(index));
        }

        emit ReApplyForInter(roomAddr, tableId, selectedNum);
        if(finish) {
            return "inter not enougth";
        }
        return "";
    }
    /**
     * @dev Inter
     * @param tableId   tableID
     * @param playerAddr  
     * @param interAddr Inter
     */
    function failInter(uint tableId, address playerAddr,address interAddr) public returns(string) {
        address roomAddr = msg.sender;
        address[] memory inters = getRoomTableInters(roomAddr, tableId);
        var (playingNum, playingPlayers) = RoomBasic(roomAddr).getTablePlayingPlayers(tableId);
        uint i;
        bool flg;



        // 
        flg = false;
        uint index  = 0;
        for(i = 0; i < room2tbExcNr[roomAddr][tableId].length; i++) {
            if(interAddr == room2tbExcNr[roomAddr][tableId][i].addr) {
                flg = true;
                index = i;
                break;
            }
        }

        if(!flg) {
            room2tbExcNr[roomAddr][tableId].push(ExceptionInfo(interAddr, new address[](0), 0));
            index = 0;
        }

        // inter
        flg = false;
        for(i = 0; i < room2tbExcNr[roomAddr][tableId][index].players.length; i++) {
            if (playerAddr == room2tbExcNr[roomAddr][tableId][index].players[i]) {
                flg = true;
                break;
            }
        }
        if(flg){
            return "already reported";
        }

        // tabletabletabletable
        room2tbExcNr[roomAddr][tableId][index].players.push(playerAddr);

        emit RportFailInter(roomAddr, tableId, interAddr);

        if(playingNum == room2tbExcNr[roomAddr][tableId][index].players.length) {
            // 
            if(1 != room2tbExcNr[roomAddr][tableId][index].status) {
                nrAddr2failCout[interAddr]++;
                emit RecordFailInter(roomAddr, tableId, interAddr);
            }
            room2tbExcNr[roomAddr][tableId][index].status = 1;
            return "success";
        }
        return "";
    }

    /**
     * @dev tableInter
     * @param roomAddr  
     * @param tableId   TableID
     * @param number    Inter
     */
    function applyForInters(address roomAddr, uint tableId, uint number) public {
        address playerAddr = msg.sender;
        address[] memory talbePlayers= RoomBasic(roomAddr).getTablePlayers(tableId);

        uint i;
        bool flg = false;
        for(i = 0; i < talbePlayers.length; i++) {
            if(playerAddr == talbePlayers[i]) {
                flg = true;
                break;
            }
        }
        require(true == flg);

        require(0 == room2tbInAddr[roomAddr][tableId].length);
        require(number > 0);
        uint interNum = numberOfInter();
        uint interUnlockNum = numberOfUnlockInter();
        require(number <= interUnlockNum);

        uint8[] memory selected = new uint8[](interNum);
        for(i = 0; i < interNum; i++) {
            selected[i] = 0;
        }

        uint selectedNum = number;

        uint index;
        uint seed = uint(msg.sender);
        while(number > 0) {
            seed = rand(seed);
            index = seed % interNum;
            while(1 == selected[index] || 0 != addr2Inters.getValueByIndex(index).locktime) {
                index = (index + 1) % interNum;
            }

            number--;
            selected[index] = 1;
            room2tbInAddr[roomAddr][tableId].push(addr2Inters.getKeyByIndex(index));
        }

        room2tbNrNum[roomAddr][tableId] = selectedNum;

        emit ApplyForInter(roomAddr, tableId, selectedNum);
    }

    /**
     * @dev tableInter
     * @param tableId   TableID
     */
    function reApplyForInters(uint tableId) public {
        address roomAddr = msg.sender;

        if(!games[msg.sender]) {
            return;
        }

        uint interNum = numberOfInter();
        uint i;

        uint8[] memory selected = new uint8[](interNum);
        for(i = 0; i < interNum; i++) {
            selected[i] = 0;
        }

        address tmpAddr;
        for(i = room2tbInAddr[roomAddr][tableId].length; i > 0; i--) {
            tmpAddr = room2tbInAddr[roomAddr][tableId][i - 1];
            room2tbInAddr_I[roomAddr][tableId].push(tmpAddr);
            delete room2tbInAddr[roomAddr][tableId][i - 1];
        }

        room2tbInAddr[roomAddr][tableId].length = 0;

        for(i = 0; i < room2tbInAddr_I[roomAddr][tableId].length; i++) {
            tmpAddr = room2tbInAddr_I[roomAddr][tableId][i];
            if(addr2Inters.contains(tmpAddr)) {
                selected[addr2Inters.getIndexByKey(tmpAddr)] = 1;
            }
        }

        uint number = room2tbNrNum[roomAddr][tableId];
        uint selectedNum = 0;

        uint index;
        uint guard;
        bool finish;
        uint seed = uint(msg.sender);
        while(selectedNum < number) {
            seed = rand(seed);
            index = seed % interNum;
            guard = index;
            finish = false;
            while(1 == selected[index] || 0 != addr2Inters.getValueByIndex(index).locktime) {
                index = (index + 1) % interNum;
                if(index == guard) {
                    finish = true;
                    break;
                }
            }

            if(finish) {
                break;
            }

            selectedNum++;
            selected[index] = 1;
            room2tbInAddr[roomAddr][tableId].push(addr2Inters.getKeyByIndex(index));
        }

        emit ReApplyForInter(roomAddr, tableId, selectedNum);
    }

    /**
     * @dev Inter
     * @param roomAddr  room
     * @param tableId   tableID
     * @param interAddr Inter
     */
    function reportFailInter(address roomAddr, uint tableId, address interAddr) public {
        //  PLAYING Inter,

        address playerAddr = msg.sender;

        if(!games[roomAddr]) {
            return;
        }

        // address[] memory playingPlayers = RoomBasic(roomAddr).getTablePlayingPlayers(tableId);
        var (playingNum, playingPlayers) = RoomBasic(roomAddr).getTablePlayingPlayers(tableId);
        address[] memory inters = getRoomTableInters(roomAddr, tableId);

        uint i;
        bool flg;

        // 
        // uint playingNum = playingPlayers.length;
        flg = false;
        for(i = 0; i < playingNum; i++) {
            if(playerAddr == playingPlayers[i]) {
                flg = true;
                break;
            }
        }
        require(true == flg);

        // tableInter
        flg = false;
        for(i = 0; i < inters.length; i++) {
            if(interAddr == inters[i]) {
                flg = true;
                break;
            }
        }
        require(true == flg);

        // 
        flg = false;
        uint index  = 0;
        for(i = 0; i < room2tbExcNr[roomAddr][tableId].length; i++) {
            if(interAddr == room2tbExcNr[roomAddr][tableId][i].addr) {
                flg = true;
                index = i;
                break;
            }
        }

        if(!flg) {
            room2tbExcNr[roomAddr][tableId].push(ExceptionInfo(interAddr, new address[](0), 0));
            index = 0;
        }

        // inter
        flg = false;
        for(i = 0; i < room2tbExcNr[roomAddr][tableId][index].players.length; i++) {
            if (playerAddr == room2tbExcNr[roomAddr][tableId][index].players[i]) {
                flg = true;
                break;
            }
        }
        require(false == flg);

        // tabletabletabletable
        room2tbExcNr[roomAddr][tableId][index].players.push(playerAddr);

        emit RportFailInter(roomAddr, tableId, interAddr);

        if(playingNum == room2tbExcNr[roomAddr][tableId][index].players.length) {
            // 
            if(1 != room2tbExcNr[roomAddr][tableId][index].status) {
                nrAddr2failCout[interAddr]++;
                emit RecordFailInter(roomAddr, tableId, interAddr);
            }
            room2tbExcNr[roomAddr][tableId][index].status = 1;
        }
    }

    /**
     * @dev tableinter
     * @param tableid tableid
     */
    function release(uint256 tableid) public {
        //assert(msg.sender == tableMgrAddr);
        delete room2tbInAddr[msg.sender][tableid];
    }

    /**
